import React, { useState, useEffect } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';

const TelemetryCharts = ({ telemetry }) => {
  const [chartData, setChartData] = useState([]);

  useEffect(() => {
    if (telemetry.timestamp) {
      const newPoint = {
        time: new Date().toLocaleTimeString(),
        altitude: telemetry.alt || 0,
        speed: telemetry.groundspeed || 0,
        battery: telemetry.battery_remaining || 0,
      };

      setChartData(prev => [...prev.slice(-50), newPoint]);
    }
  }, [telemetry]);

  return (
    <div className="charts-container">
      <h3>Telemetry Charts</h3>
      
      <div className="chart-grid">
        <div className="chart">
          <h4>Altitude (m)</h4>
          <ResponsiveContainer width="100%" height={200}>
            <LineChart data={chartData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="time" />
              <YAxis />
              <Tooltip />
              <Line type="monotone" dataKey="altitude" stroke="#3b82f6" strokeWidth={2} />
            </LineChart>
          </ResponsiveContainer>
        </div>

        <div className="chart">
          <h4>Speed (m/s)</h4>
          <ResponsiveContainer width="100%" height={200}>
            <LineChart data={chartData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="time" />
              <YAxis />
              <Tooltip />
              <Line type="monotone" dataKey="speed" stroke="#10b981" strokeWidth={2} />
            </LineChart>
          </ResponsiveContainer>
        </div>

        <div className="chart">
          <h4>Battery (%)</h4>
          <ResponsiveContainer width="100%" height={200}>
            <LineChart data={chartData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="time" />
              <YAxis />
              <Tooltip />
              <Line type="monotone" dataKey="battery" stroke="#f59e0b" strokeWidth={2} />
            </LineChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );
};

export default TelemetryCharts;
